import React, { useState, useEffect } from 'react'
import axios from 'axios'

function NbaSchedule() {
	const [nbaGames, setGames] = useState([])

	useEffect(() => {
		axios
			.get("https://v1.basketball.api-sports.io/games?date=2021-10-03&league=12&season=2021-2022", {
				"headers": {
					"x-rapidapi-host": "v1.basketball.api-sports.io",
					"x-rapidapi-key": "9d9a715447e2a3dbbeebac5d5297ce60"	
				}			
			})
			.then(response => {
				console.log(response.data.response[0])
				setGames(response.data.response[0].teams.away.name)
			})
	}, [])

	return (
		<div>
			<h3>Nba Schedules</h3>
			{ JSON.stringify(nbaGames) }
		</div>	
	)
}

export default NbaSchedule
